import React from "react";

const IntroRow: React.FC = () => {
  return (
    <div>
      <div> This is the intro row</div>
      <div>
        <img src={require("../assets/images/me.jpg")} alt="me" />
      </div>
    </div>
  );
};

export default IntroRow;
